@ProcessorTest @WithClasses(MapToBeanTypeCheckMapper.class)@ExpectedCompilationOutcome(
        value = CompilationResult.SUCCEEDED,
        diagnostics ={
            @Diagnostic(
                type = MapToBeanTypeCheckMapper.class,
                kind = javax.tools.Diagnostic.Kind.WARNING,
                line = 21,
                message = "Unmapped target property: \"value\"."
            ),
            @Diagnostic(
                type = MapToBeanTypeCheckMapper.class,
                kind = javax.tools.Diagnostic.Kind.WARNING,
                line = 21,
                message = "The Map parameter \"source\" cannot be used for property mapping. " +
                    "It must be typed with Map<String, ???> but it was typed with Map<Integer,String>."
            ),
        }

@ProcessorTest @WithClasses(MapToBeanRawMapMapper.class)@ExpectedCompilationOutcome(
        value = CompilationResult.SUCCEEDED,
        diagnostics ={
            @Diagnostic(
                type = MapToBeanRawMapMapper.class,
                kind = javax.tools.Diagnostic.Kind.WARNING,
                line = 21,
                message = "Unmapped target property: \"value\"."
            ),
            @Diagnostic(
                type = MapToBeanRawMapMapper.class,
                kind = javax.tools.Diagnostic.Kind.WARNING,
                line = 21,
                message = "The Map parameter \"source\" cannot be used for property mapping. " +
                    "It must be typed with Map<String, ???> but it was raw."
            ),
        }

@ProcessorTest @WithClasses(MapMapper.class)@ExpectedCompilationOutcome(value = CompilationResult.SUCCEEDED,
        diagnostics ={
            @Diagnostic(type = MapMapper.class,
                kind = javax.tools.Diagnostic.Kind.WARNING,
                line = 19,
                message = "map key has a possibly lossy conversion from Long to Integer."),
            @Diagnostic(type = MapMapper.class,
                kind = javax.tools.Diagnostic.Kind.WARNING,
                line = 19,
                message = "map value has a possibly lossy conversion from Double to Float.")
    }
